import './App.css';
import Navbar from './components/Navbar.js'
import Item from './components/Item'
import Model3 from './components/assets/Desktop-Model3.jpeg'
import ModelS from './components/assets'
function App() {
  return (
    <div className="App">
      <Navbar />
      <Item 
        title="Model 3"
        backgroundimg={Model3}
        text="Réservez un essai sans contract"
        textbottom="A reçu la note maximale de 5 étoiles par Euro NCAP"
        />
        <Item 
        title="Model S"
        backgroundimg={Model3}
        text="Réservez un essai sans contract"
        textbottom="A reçu la note maximale de 5 étoiles par Euro NCAP"
        />
        <Item 
        title="Model X"
        backgroundimg={Model3}
        text="Réservez un essai sans contract"
        textbottom="A reçu la note maximale de 5 étoiles par Euro NCAP"
        />  
    </div>
  );
}

export default App;
